const useOllama = async (prompt) => {
    const res = await fetch('http://localhost:7001/api/llm/parse', {
      method: 'POST',
      headers: {'Content-Type': 'application/json'},
      body: JSON.stringify({ prompt })
    });

    const data = await res.json();
    return data;
  }
